import React from "react";

const customerFooter = () => {
  return (
    <React.Fragment>
      <footer class="py-5 bg-success text-white">
        <div class="container">
          <h1>Copyright &copy; </h1>
        </div>
      </footer>
    </React.Fragment>
  );
};

export default customerFooter;
